import "./index.css";

import { Component } from "react";

class Remainder extends Component {
  state = { remainderList: [] };

  render() {
    return (
      <div className="bg-container">
        <h1 className="main-head">Remainder</h1>
        <div className="remainder-container">
          <div className="remainder-card-container">
            <div className="remainder-input-container">
              <label for="text" className="remainder-input-label">
                Add Task
              </label>
              <input type="text" className="remainder-input" id="text" />
              <label for="date" className="remainder-input-label">
                Add Date
              </label>
              <input type="date" className="remainder-input" id="date" />
              <label for="time" className="remainder-input-label">
                Add Time
              </label>
              <input type="time" className="remainder-input" id="time" />
            </div>
          </div>
          <div className="remainder-list-container"></div>
        </div>
      </div>
    );
  }
}

export default Remainder;
